import { useNavigate } from "react-router-dom"

function Home() {
    
    const navigate = useNavigate()

    function handleLogout() {    
            localStorage.removeItem("token")
            localStorage.removeItem("email")
            navigate("")
    }
    
    return(
        <>
        Home
        </>
    )
}

export default Home
